import { useEffect } from "react";

function FetchRealTime({ onDataFetch }) {
    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/get_real_time_data/')
            .then(response => response.json())
            .then(data => {
                if (onDataFetch) {
                    onDataFetch(data)
                    console.log(data);
                }
            })
            .catch(error => console.error('Error Stock Data:', error));
    }, [onDataFetch]);

    return null;
}

export default FetchRealTime;
